    const [ decks, setDecks ]= useState([]);

    return (
        <div> 
            <Link to="/decks/new" className="btn btn-warning create">Create Deck</Link>

            <Route>
                <DeckList decks={decks}/>
            </Route>

        </div>
    )
}
